const font = '';

export function registerFont(jsPDF) {
  function callAddFont() {
    this.addFileToVFS('Ubuntu-Regular-bold.ttf', font);
    this.addFont('Ubuntu-Regular-bold.ttf', 'Ubuntu-Regular', 'bold');
  }
  jsPDF.API.events.push(['addFonts', callAddFont])
}
